import React from 'react';

const MangaItem = ({ manga }) => (
  <div className="manga">
    <a href={'/manga/:${manga.id}'}>
      <img src={`images/${manga.image}`} alt={manga.title} />
    </a>
    <h2>{manga.rank} : {manga.title}</h2>
    <p>Note : {manga.rating}/10</p>
  </div>
);

export default MangaItem;
